  `company_name` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '公司营业执照全称/姓名',
  `enterprise_type` tinyint(1) DEFAULT '1' COMMENT '企业类型(1:商家 2:个人)',
