  `id_num_pic` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '营业执照图片/身份证图片',
  `tax_reg_cert_pic` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '税务登记证图片',
  `hand_legal_id_pic` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '个人手持身份证照片',
  `legal_id_num_front_pic` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '法人身份证正面图片',
  `legal_id_num_behind_pic` varchar(200) CHARACTER SET utf8 DEFAULT NULL COMMENT '法人身份证反面图片',
  `legal_id_num_encrypt` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '法人身份证号密文',
  `legal_id_num_type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '0:身份证，1:台胞证',
  `legal_id_name_encrypt` varchar(500) CHARACTER SET utf8 DEFAULT NULL COMMENT '法人姓名密文',
  `code` varchar(200) CHARACTER SET utf8 DEFAULT '' COMMENT '唯一编码（邀请码）',
  `pic_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '0:非三证合一，1:三证合一',
  `established` datetime DEFAULT NULL COMMENT '成立日期',
  `operating_period_type` tinyint(2) NOT NULL DEFAULT '0' COMMENT '营业时间类型 0：固定日期 1：长期有效',
  `country_id` int(11) NOT NULL DEFAULT '1',
  `country_name` varchar(50) CHARACTER SET utf8 NOT NULL,
  `province_id` int(11) NOT NULL DEFAULT '0' COMMENT '省级编号',
  `province_name` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '省名称',
  `city_id` int(11) NOT NULL DEFAULT '0' COMMENT '市级编号',
  `city_name` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '市名称',
  `county_id` int(11) NOT NULL DEFAULT '0' COMMENT '区/县级编号',
  `county_name` varchar(50) CHARACTER SET utf8 NOT NULL COMMENT '区县名称',
  `audit_status` int(1) NOT NULL COMMENT '审核状态：-1 信息不完整 0 未审核 ，1 审核通过 ， 2 拒审',
  `gmt_created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `is_del` int(1) NOT NULL COMMENT '0正常，1禁用',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1900 DEFAULT CHARSET=utf8mb4 COMMENT='公司基础信息表';

