DROP TABLE IF EXISTS `sys_resource`;
CREATE TABLE `sys_resource` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '主键，根节点为0',
  `parent_id` int(11) NOT NULL DEFAULT '0' COMMENT '自关联id',
  `resource_type` int(1) NOT NULL DEFAULT '0' COMMENT '资源类型（0：菜单，1：按钮，2：页面）',
  `code` varchar(60) CHARACTER SET utf8 NOT NULL DEFAULT '' COMMENT '资源代码',
  `icon` varchar(60) CHARACTER SET utf8 DEFAULT NULL COMMENT '菜单图标',
  `name` varchar(60) CHARACTER SET utf8 NOT NULL COMMENT '页面的菜单名称',
  `url` varchar(255) CHARACTER SET utf8 DEFAULT NULL COMMENT '菜单url',
  `is_open` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否打开新页面0：是，1：否',
  `sort` int(11) NOT NULL COMMENT '菜单排序，数字越小位置越靠上',
  `gmt_created` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `gmt_modified` datetime NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '修改时间',
  `is_del` tinyint(4) NOT NULL DEFAULT '0' COMMENT '菜单状态,0禁用，1删除',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_res_code` (`code`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1403 DEFAULT CHARSET=utf8mb4 COMMENT='商家后台菜单页面资源表';

